import React, { Fragment, useState } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import Select from "react-select";

function Filter() {
  const [city, setCity] = useState({ selectedOption: "" });

  const cities = [
    { label: "Szeged", value: "szeged" },
    { label: "Budapest", value: "bp" },
  ];

  const handleInputChange = (event) => {
    setCity(event.target.value);
  };
  console.log({ city });

  return (
    <>
      <form>
        <h4>Város</h4>

        <Select
          options={cities}
          className="btn border-dark"
          name="city"
          onChange={handleInputChange}
          value={city.selectedOption}
          //value={city}
          //defaultInputValue={{ label: "Szeged", value: "szeged" }}
        />

        <div>
          <h4>Irányítószám</h4>
          <select
            //value={status}
            className="btn border-dark"
            //onChange= city =
            name="filterWorkSheetByStatus"
          >
            <option>6765</option>
            <option>6978</option>
          </select>
        </div>
        <div className="form-check">
          <input
            class="form-check-input"
            type="radio"
            name="exampleRadios"
            id="exampleRadios1"
            value="option1"
            checked
          />
          <label class="form-check-label" for="exampleRadios1">
            Lakossági
          </label>
        </div>
        <div class="form-check">
          <input
            class="form-check-input"
            type="radio"
            name="exampleRadios"
            id="exampleRadios1"
            value="option1"
            checked
          />
          <label class="form-check-label" for="exampleRadios1">
            Közösségi
          </label>
        </div>
      </form>
      <div>Backendre továbbítandó: {city} </div>
    </>
  );
}

export default Filter;
